window.bookSummaryJSON = "<p><b>Is this the end?</b></p> <p>Magic is dying in the land of Valka. With only two virus nodes remaining, dragons have emerged in great numbers to spread corruption to every corner of Beta.</p> <p>With no allies left, Illume is forced to return to Valka. He plans to call in every favor, summon every ally. The Cryomancer will bring every ounce of strength to the distant shores.</p> <p>Join Illume as he ventures into the very depths of Hel itself to slay gods, ally with giants, and steal the heart of an ancient enemy. With the computer virus spreading to their winged foes, will our Cryomancer be able to gather the Spirit Weapons in time to stop them from crossing the straight and spreading their corruption to Valka?</p> <p><i>Follow Illume, Ingrid, Trillian, and Nari as they join forces with the World Serpent, slay Surtur, fight Odin, and face down a dragon the size of a continent. Will they be able to weather this storm? Will the waning magic be enough to stop Zshazmark, or will they have to call on something darker, and far more ancient?</i></p>"; 
